import React, { useRef } from 'react';
import {  IonButton, IonCol, IonContent, IonHeader, IonIcon, IonImg, IonInfiniteScroll, IonItem, IonItemDivider, IonList, IonPage, IonRow, IonText, IonTitle, IonToolbar } from '@ionic/react';
import './Tab1.css';
import '../global_styles.css';

import john from '../images/john.jpg'
import heart from '../images/rsz_heart.png'
import ice from '../images/rsz_ice_cream.jpg'


const Tab1: React.FC = () => {
  

  return (
    <IonPage>
      <IonHeader>
        <IonToolbar className="header">
          <IonTitle >ClubHub</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent fullscreen>
          <IonInfiniteScroll>
            <IonList>
              <Post/>
            </IonList>
          </IonInfiniteScroll>

      </IonContent>
    </IonPage>
  );
};


interface PostProps {
  club_name: string;
  club_image: string;
  post_description: string;
  post_date: string;
  post_image: string;
  post_time: string;
  post_title: string;
}

const test_post = {club_name: "Cal Poly Ice Cream Club", club_image: ice,
 post_description: "Eat ice cream angrily", post_date: "May 2nd", post_time: "12pm - 5pm", post_title: "Agressive Ice Cream Eating"}

const Post: React.FC<PostProps> = (props) => {
  return (
    <IonItem>
      <IonCol>
        <IonItemDivider className="club-banner" > 
          <IonRow>
            <IonImg src={props.club_image}></IonImg>
            <IonCol>{props.club_name}</IonCol>
          </IonRow>
        </IonItemDivider>
        <IonRow><IonImg src={props.post_image}></IonImg></IonRow>
        <IonItemDivider className="details">
          <IonCol>{props.post_title}</IonCol>
          <IonCol>{props.post_date}</IonCol>
          <IonCol>{props.post_time}</IonCol>
        </IonItemDivider>
        <IonRow>
          <IonImg src={heart}></IonImg>
          <IonCol>{props.post_description}</IonCol>
        </IonRow>
      </IonCol>
    </IonItem>
  )
}

export default Tab1;
